import React from 'react'

function JumboTron({ children }) {
    const styles = {
        height: 300,
        clear: "both",
        paddingTop: 120,
        textAlign: "center"
    }



    return(
        <div style={styles} className="jumbotron">
            {children}
        </div>
    )
}

export default JumboTron
